uniform float brightness;

in vec3 pos;

void main()
{
    float tr = 1000;
    float tr1 = 500;
    float tr2 = 0.5;
    float r = floor(sin((pos.x+pos.y+pos.z)* tr1) * cos((pos.x+pos.y+pos.z)* tr) + tr2 * brightness)*.5;
    float g = r*1.5+0.25;
    float b = r*1+0.5;
    float a = r+0.5;

    gl_FragColor = vec4(r, g, b, a);
}

